import '../App.css'
import '../Estilos/Shop.css'
import ProductoItem from '../Componentes/Novedades/ProductoItem'


const Shop = ({producto})=>{
    return (
        <div className="contenedor-img">
        {producto.map((producto, index) => (
            <div className="item" key={index}>
                <figure>
                    <img src={producto.pr_img} className="img-s" alt="producto" />
                </figure>
                <div className="info-item">
                    <h2>{producto.pr_descripcion}</h2>
                    <p className="precio">{producto.pr_precio}</p>
                    <button className="bn">Lo quiero!</button>
                </div>
            </div>
        ))}
    </div>
    )
}
export default Shop;
